import React, { useState, useEffect } from 'react';
import axios from 'axios';

const MyComponent = () => {
    const [items, setItems] = useState([]);

    useEffect(() => {
        axios.get('http://127.0.0.1:8000/kategori/istanbul')
            .then(response => {
                const parser = new DOMParser();
                const htmlDocument = parser.parseFromString(response.data, 'h1');
                const nameElements = htmlDocument.querySelectorAll('.your-selector'); // CSS sınıflarını veya etiket adlarını kullanarak uygun seçiciyi belirtin
                console.log(htmlDocument.it)
                const names = Array.from(nameElements).map(element => element.textContent);
                setItems(names);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    }, []);

    return (
        <div>
            <h1>Items</h1>
            <ul>
                {items.map((name, index) => (
                    <li key={index}>{name}</li>
                ))}
            </ul>
        </div>
    );
};

export default MyComponent;
